import React from 'react'
import { Stack,Typography } from '@mui/material'
import Icon from '../assets/icons/gym.png'
import { BorderBottom, BorderTop } from '@mui/icons-material'

const BodyPart = (item,setBodyPart,bodyPart) => {
  return (
    <Stack type='button' alignItems='center' justifyContent='center' className='bodyPart-card' sx={
        bodyPart === item ?{ BorderTop:'4px solid #ff2625', borderTopLeftRadius:'20px',backgroundColor : '#fff',BorderBottom:'20px',width:'270px' ,height:'280px' ,cursor:'pointer',gap:'47px'}: {
            background:'#fff',
            borderTopLeftRadius:'20px',
            width:'270px' ,height:'280px' ,cursor:'pointer',gap:'47px'
        }

    }>
        <img src={Icon} alt="dubmbel"  style={{width:'40px', height:'40px'}}/>
    </Stack>
  )
}

export default BodyPart
